import { Button } from 'react-bootstrap';
import './App.css';
import Feed from './components/Feed';
import NavBar from './components/Navbar'
import { LightbulbFill } from "bootstrap-icons";

function App() {
  return (
    <div className="App">
      <header>
        <NavBar />
      </header>
      <body>
        <Feed />
      </body>
      <Button><LightbulbFill /></Button>
    </div>
  );
}

export default App;
